pragma solidity >=0.4.21;
pragma experimental ABIEncoderV2;

contract AnalystContract{

    struct AnalystStruct {
      string username;
      string email;
    }

    mapping (address => AnalystStruct) public AnalystMapping;

    function registerAnalyst(address _Analystaddr, string memory name, string memory email) public 
    {
        AnalystMapping[_Analystaddr]=AnalystStruct(name,email);
    }

    function getAnalyst(address _Analystaddr) public view returns (AnalystStruct memory _AnalystStruct) {
        return AnalystMapping[_Analystaddr];
    }

}
